def run(value_list):
    """
    Calculates the average global regional films (excluding Tamil films) from 2017-2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    data = []
    for item in value_list:
        if item['category'] == 'Regional films (excluding Tamil films)' and item['header2'] in ['2017', '2018', '2019']:
            data.append(item)

    if not data:
        return (0.0, '')

    total = 0
    count = 0
    for item in data:
        total += item['number_value']
        count += 1

    average = total / count

    if average == 0.0:
        return (0.0, '')

    if average < 1000:
        scale = 'thousand'
    elif average < 1000000:
        scale = 'thousand'
    elif average < 100000000:
        scale = 'million'
    elif average < 1000000000:
        scale = 'billion'
    else:
        scale = 'thousand'

    return (round(average, 2), scale)

