            elif '2017' in item['header2']:
                gross_margin_values.append(float(item['number_value']))

    if not gross_margin_values:
        return (0.00, '')

    average_margin = sum(gross_margin_values) / len(gross_margin_values)
    return (round(average_margin, 2), '')

def run(value_list):
    """
    Calculates the proportion of long-term debt payments due in 5 years or below.

    Args:
        value_list: A list of dictionaries containing financial report data.

    Returns:
        A tuple (number, scale) representing the proportion.
    """
    long_term_debt_5_years = 0
    total_long_term_debt = 0

    for item in value_list:
        if item['category'] == 'Long-term debt .':
            if item['header1'] in ['1-3 Years', '3-5 Years', 'After 5 Years']:
                long_term_debt_5_years += item['number_value']
                total_long_term_debt += item['number_value']

    if total_long_term_debt == 0:
        return (0.00, "")

    proportion = (long_term_debt_5_years / total_long_term_debt) * 100
    return (round(proportion, 2), "percent")

def run(value_list):
    """
    Calculates the ratio (in percentage) of total notes payable to total capital lease obligations.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    total_notes_payable = 0
    total_capital_lease_obligations = 0

    for item in value_list:
        if item['category'] == 'Notes payable':
            if item['header1'] == 'Total':
                total_notes_payable = item['number_value']
            elif item['header1'] == 'Less than 1 Year':
                total_notes_payable = item['number_value']
        elif item['category'] == 'Capital lease obligations':
            if item['header1'] == 'Total':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == 'Less than 1 Year':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == '1-3 Years':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == '3-5 Years':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == 'After 5 Years':
                total_capital_lease_obligations = item['number_value']

    if total_capital_lease_obligations == 0:
        return (0.00, "")

    ratio = (total_notes_payable / total_capital_lease_obligations) * 100
    return (round(ratio, 2), "percent")

def run(value_list):
    """
    Calculates the percentage increase/decrease in the total from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    total_2018 = 0
    total_2019 = 0

    for item in value_list:
        if item['header1'] == '2018':
            total_2018 += item['number_value']
        elif item['category'] == 'Total':
            total_2019 += item['number_value']

    if total_2018 == 0 or total_2019 == 0:
        return (0.00, '')

    percentage_change = ((total_2019 - total_2018) / total_2018) * 100
    return (round(percentage_change, 2), '%')

def run(value_list):
