    total_non_vested_2019 = 0
    for item in value_list:
        if item['category'] == 'Non-vested at December 31, 2019':
            total_non_vested_2019 += item['number_value']

    if total_non_vested_2019 == 0:
        return (0.00, '')

    percentage = (non_vested_2019 / total_non_vested_2019) * 100
    return (round(percentage, 2), 'percent')

